func NewWhitebit(userConfig map[string]interface{}) *Whitebit {
	p := NewWhitebitCore()
	p.Init(userConfig)
	return &Whitebit{
		WhitebitCore:  p,
		Core:          p,
		exchangeTyped: NewExchangeTyped(&p.Exchange),
	}
}
func NewWhitebitFromCore(core *WhitebitCore) *Whitebit {
	return &Whitebit{
		WhitebitCore:  core,
		Core:          core,
		exchangeTyped: NewExchangeTyped(&core.Exchange),
	}
}

